function Get-ApplicationShimming{

    $Custom = Get-ChildItem -Path 'HKLM:\SOFTWARE\Microsoft\Windows NT\CurrentVersion\AppCompatFlags\Custom' -Recurse|  Get-ItemProperty | Select-Object * -ExcludeProperty PSProvider, PSParentPath, PSPath

    Get-ChildItem -Path 'HKLM:\SOFTWARE\Microsoft\Windows NT\CurrentVersion\AppCompatFlags\InstalledSDB' -Recurse | Get-ItemProperty | Select-Object * -ExcludeProperty PSProvider, PSParentPath | ForEach-Object {
        $_ | Add-Member NoteProperty Category "Application Shimming" -Force
        $sdb_name = "$($_.PSChildName).sdb"
        $Process = $Custom | ForEach-Object {
            if ($sdb_name -in ($_ | get-member | Where-Object {$_.MemberType -eq "NoteProperty"}).Name){
                $_.PSChildName
            }
        }
        $_ | Add-Member NoteProperty Process $Process -Force
        if (Test-Path -Path $_.DatabasePath -PathType Leaf){
            $sign = Get-Signature $_.DatabasePath
            if ($sign -eq "(Verified) Microsoft Corporation"){
                Continue
            }
            $_ | Add-Member NoteProperty Signer $sign -Force
            $hash = Get-FileHash $_.DatabasePath
            $_ | Add-Member NoteProperty MD5 $hash -Force
        }
        $_
    }
}

function  Get-BrowserExtensions{
    $path = @('C:\Users\*\AppData\Local\Google\Chrome\User Data\*\Extensions\*', 'C:\Documents and Settings\*\Application Data\Mozilla\Firefox\Profiles\*\extensions\*','C:\Users\*\AppData\Roaming\Mozilla\Firefox\Profiles\*\extensions\*')
    $path | Get-Item | Select-Object Name, FullName | Where-Object { $_.Name -ne "Temp"} | ForEach-Object {
        $Name = $_.Name;
        Get-ChildItem -Path $_.FullName -Recurse -Force -Include *.js,*.html, *.json| Select-Object LastWriteTimeUtc, Length, FullName | ForEach-Object {
            $_ | Add-Member NoteProperty Category "Browser Extensions" -Force
            $_ | Add-Member NoteProperty Name $Name -Force
            $_.LastWriteTimeUtc = Get-Date -Date $_.LastWriteTimeUtc -Format "MM-dd-yyyy HH:mm:ss tt"
            if (Test-Path -Path $_.FullName -PathType Leaf){
                $hash = Get-FileHash $_.FullName
                $_ | Add-Member NoteProperty MD5 $hash -Force
            }
            $_
        }
    }
}

function Get-ChangeDefaultFileAssociation {
    Get-ItemProperty -Path 'HKCU:\Software\Microsoft\Windows\CurrentVersion\Extensions' | Select-Object * -ExcludeProperty PSProvider, PSParentPath, PSChildName, PSDrive | ForEach-Object {
        $_ | Add-Member NoteProperty Category "Change Default File Association" -Force
        $_
    }
    Get-Item -Path 'HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\FileExts\*\OpenWithList'  | Get-ItemProperty | Select-Object * -ExcludeProperty PSProvider, PSParentPath, PSDrive  | ForEach-Object {
        $_ | Add-Member NoteProperty Category "Change Default File Association" -Force
        $_
    }
}

function Get-ComponentObjectModelHijacking {
    $path = @('HKLM:\Software\Classes\CLSID\*', 'HKCU:\Software\Classes\CLSID\*')
    $keys = $path | Get-ChildItem -Recurse| Where-Object {$_.'Name' -match 'InProcServer32$' -or $_.'Name' -match 'LocalServer32$'}  | Get-ItemProperty | Select-Object '(default)', PSParentPath | Where-Object {$_.'(default)'.Length -gt 1}
    foreach ($key in $keys){
        $p = Get-Path $key.'(default)'
        if ($p.Count){
            $sign = Get-Signature $p
            if ($sign -eq "(Verified) Microsoft Corporation"){
                Continue
            }
            $key | Add-Member NoteProperty Signer $sign -Force
            $hash = Get-FileHash $p
            $key | Add-Member NoteProperty MD5 $hash -Force
        }
        $key | Add-Member NoteProperty Category "Component Object Model Hijacking" -Force
        $key
    }
}

function Get-ModifyExistingService {
    <#
    .SYNOPSIS

    Helper - Enumerates services (based on the registry)

    Author: @itm4n
    License: BSD 3-Clause

    .DESCRIPTION

    This uses the registry to enumerate the services by looking for the subkeys of
    "HKEY_LOCAL_MACHINE\SYSTEM\CurrentControlSet\Services". This allows any user to get information
    about all the services. So, even if non-privileged users can't access the details of a service
    through the Service Control Manager, they can do so simply by accessing the registry.

    .PARAMETER FilterLevel

    This parameter can be used to filter out the result returned by the function based on the
    following criteria:
        FilterLevel = 0 - No filtering
        FilterLevel = 1 - Exclude 'Services with empty ImagePath'
        FilterLevel = 2 - Exclude 'Services with empty ImagePath' + 'Drivers'
        FilterLevel = 3 - Exclude 'Services with empty ImagePath' + 'Drivers' + 'Known services'

    .EXAMPLE

    PS C:\> Get-ServiceList -FilterLevel 3

    Name         : VMTools
    DisplayName  : VMware Tools
    User         : LocalSystem
    ImagePath    : "C:\Program Files\VMware\VMware Tools\vmtoolsd.exe"
    StartMode    : Automatic
    Type         : Win32OwnProcess
    RegistryKey  : HKEY_LOCAL_MACHINE\SYSTEM\CurrentControlSet\Services\VMTools
    RegistryPath : Microsoft.PowerShell.Core\Registry::HKEY_LOCAL_MACHINE\SYSTEM\CurrentControlSet\Services\VMTools

    .NOTES

    A service "Type" can be one of the following:
        KernelDriver = 1
        FileSystemDriver = 2
        Adapter = 4
        RecognizerDriver = 8
        Win32OwnProcess = 16
        Win32ShareProcess = 32
        InteractiveProcess = 256

    #>
    function Convert-ServiceTypeToString {
        <#
        .SYNOPSIS
    
        Helper - Converts a service type (integer) to its actual name
    
        Author: @itm4n
        License: BSD 3-Clause
    
        .DESCRIPTION
    
        Services have a type which is saved as an integer in the registry. This function will retrieve
        the "name" of the type based on this integer value.
    
        .PARAMETER ServiceType
    
        A service type as an integer
    
        .EXAMPLE
    
        PS C:\> Convert-ServiceTypeToString -ServiceType 16
    
        Win32OwnProcess
    
        #>
    
        [CmdletBinding()] param(
            [int]
            $ServiceType
        )
    
        $ServiceTypeEnum = @{
            "KernelDriver" =        "1";
            "FileSystemDriver" =    "2";
            "Adapter" =             "4";
            "RecognizerDriver" =    "8";
            "Win32OwnProcess" =     "16";
            "Win32ShareProcess" =   "32";
            "InteractiveProcess" =  "256";
        }
    
        $ServiceTypeEnum.GetEnumerator() | ForEach-Object {
            if ( $_.value -band $ServiceType )
            {
                $_.name
            }
        }
    }
    
    function Convert-ServiceStartModeToString {
        <#
        .SYNOPSIS
    
        Helper - Convert a Start mode (integer) to its actual name
    
        Author: @itm4n
        License: BSD 3-Clause
    
        .DESCRIPTION
    
        Services have a Start mode (e.g.: Automatic), which is saved as an integer in the registry.
        This function will retrieve the "name" of the Start mode based on this integer value.
    
        .PARAMETER StartMode
    
        A Start mode as an integer
    
        .EXAMPLE
    
        PS C:\> Convert-ServiceStartModeToString -StartMode 2
    
        Automatic
    
        #>
    
        [CmdletBinding()] param(
            [int]
            $StartMode
        )
    
        $StartModeEnum = @{
            "Boot" =        "0";
            "System" =      "1";
            "Automatic" =   "2";
            "Manual" =      "3";
            "Disabled" =    "4";
        }
    
        $StartModeEnum.GetEnumerator() | ForEach-Object {
            if ( $_.Value -eq $StartMode )
            {
                $_.Name
            }
        }
    }
    
    function Test-IsKnownService {
    
        [CmdletBinding()] param(
            [object]$Service
        )
    
        if ($Service) {
    
            $ImagePath = $Service.ImagePath
    
            $SeparationCharacterSets = @('"', "'", ' ', "`"'", '" ', "' ", "`"' ")
    
            ForEach($SeparationCharacterSet in $SeparationCharacterSets) {
    
                $CandidatePaths = $ImagePath.Split($SeparationCharacterSet) | Where-Object {$_ -and ($_.trim() -ne '')}
    
                ForEach($CandidatePath in $CandidatePaths) {
    
                    $TempPath = $([System.Environment]::ExpandEnvironmentVariables($CandidatePath))
                    $TempPathResolved = Resolve-Path -Path $TempPath -ErrorAction SilentlyContinue -ErrorVariable ErrorResolvePath
                    if (-not $ErrorResolvePath) {
    
                        $File = Get-Item -Path $TempPathResolved -ErrorAction SilentlyContinue -ErrorVariable ErrorGetItem
                        if (-not $ErrorGetItem) {
    
                            if ($File.VersionInfo.LegalCopyright -Like "*Microsoft Corporation*") {
                                return $True
                            } else {
                                return $False
                            }
                        }
                    }
                }
            }
        }
    
        return $False
    }

    $ServicesRegPath = "Registry::HKEY_LOCAL_MACHINE\SYSTEM\CurrentControlSet\Services"
    $RegAllServices = Get-ChildItem -Path $ServicesRegPath

    ForEach ($RegService in $RegAllServices) {
        $Properties = Get-ItemProperty -Path $RegService.PSPath -ErrorVariable GetItemPropertyError -ErrorAction SilentlyContinue
        if ($GetItemPropertyError) {
            # If an error occurred, skip the current item
            continue
        }

        $DisplayName = [System.Environment]::ExpandEnvironmentVariables($Properties.DisplayName)

        $ServiceItem = New-Object -TypeName PSObject
        $ServiceItem | Add-Member -MemberType "NoteProperty" -Name "Catalory" -Value "Modify Existing Service"
        $ServiceItem | Add-Member -MemberType "NoteProperty" -Name "Name" -Value $Properties.PSChildName
        $ServiceItem | Add-Member -MemberType "NoteProperty" -Name "DisplayName" -Value $DisplayName
        $ServiceItem | Add-Member -MemberType "NoteProperty" -Name "User" -Value $Properties.ObjectName
        $ServiceItem | Add-Member -MemberType "NoteProperty" -Name "ImagePath" -Value $Properties.ImagePath
        $ServiceItem | Add-Member -MemberType "NoteProperty" -Name "StartMode" -Value $(Convert-ServiceStartModeToString -StartMode $Properties.Start)
        $ServiceItem | Add-Member -MemberType "NoteProperty" -Name "Type" -Value $(Convert-ServiceTypeToString -ServiceType $Properties.Type)
        $ServiceItem | Add-Member -MemberType "NoteProperty" -Name "RegistryKey" -Value $RegService.Name
        $ServiceItem | Add-Member -MemberType "NoteProperty" -Name "RegistryPath" -Value $RegService.PSPath
        if ($Properties.ImagePath ) {
            $p = Get-Path $Properties.ImagePath
            if ($null -ne $p){
                $sign = Get-Signature $p
                if($null -ne $sign){
                    if ($sign -eq "(Verified) Microsoft Corporation"){
                        Continue
                    }
                    $ServiceItem | Add-Member NoteProperty Signer $sign -Force
                    $hash = Get-FileHash $p
                    $ServiceItem | Add-Member NoteProperty MD5 $hash -Force
                }
            }
        }
        $ServiceItem
    }
}

function Get-PowerShellProfile {
    $path = @("$($pshome)\\*profile.ps1", "$($home)\\*profile.ps1")
    $path | Get-ItemProperty | Select-Object FullName, Length, LastWriteTimeUtc | ForEach-Object -Process {
        $_ | Add-Member NoteProperty Category "PowerShell Profile" -Force
        $_.LastWriteTimeUtc = Get-Date -Date $_.LastWriteTimeUtc -Format "MM-dd-yyyy HH:mm:ss tt"
        $a = GetBase64GzippedStream($_.FullName)
        $_  | Add-Member NoteProperty Content $a -Force
        $_
    }
}

function Get-ShortcutModification{
    $path = @("C:\\Users\\*\\Desktop\\*.lnk", "C:\\Users\\*\\AppData\\*\\*.lnk")
    $sh = New-Object -ComObject WScript.Shell
    $path | Get-Item | ForEach-Object -Process {
        $link = $sh.CreateShortcut($_.FullName)
        $info = @{}
        $info.Category = "Shortcut Modification"
        $info.Entry = try { Split-Path $link.FullName -Leaf } catch { 'n/a'}
        $info."Entry Location" = $link.FullName
        $info."Image Path" = $link.TargetPath
        $info."Launch String" = $link.Arguments
        if("" -ne $info."Image Path" -and (Test-Path -Path $info."Image Path" -ErrorAction SilentlyContinue)){
            $info.Signer = Get-Signature $info."Image Path"
            if ($info.sign -eq "(Verified) Microsoft Corporation"){
                Continue
            }
            $info.MD5 = Get-FileHash $info."Image Path"
        }
        $info.Hotkey = $link.Hotkey
        $info.WindowStyle = $link.WindowStyle
        New-Object PSObject -Property $info
    }
}

function Get-SIPandTrustProviderHijacking {
    $items = Get-ChildItem -Path "HKLM:\SOFTWARE\WOW6432Node\Microsoft\Cryptography\OID\EncodingType 0\CryptSIPDllVerifyIndirectData\" -Recurse | Get-ItemProperty | Select-Object DLL, FuncName, PSPath | Where-Object {$_.DLl.length -ge 5 }
    foreach($item in $items) {
        $item | Add-Member NoteProperty Category "SIP and Trust Provider Hijacking" -Force
        $p = Get-Path $item.Dll
        if ($p){
            $sign = Get-Signature $p
            $item | Add-Member NoteProperty Signer $sign -Force
            if ($sign -eq "(Verified) Microsoft Corporation"){
                Continue
            }
            $hash = Get-FileHash $p
            $item | Add-Member NoteProperty MD5 $hash -Force
        }
        $item
    }
}

