function Get-DLLSearchOrderHijacking {
    Add-Type -MemberDefinition @'
    [DllImport("kernel32.dll", SetLastError = true, CallingConvention = CallingConvention.Winapi)]
    [return: MarshalAs(UnmanagedType.Bool)]
    public static extern bool IsWow64Process(
    [In] System.IntPtr hProcess,
    [Out, MarshalAs(UnmanagedType.Bool)] out bool wow64Process);
'@ -Name NativeMethods -Namespace Kernel32

    Get-Process | ForEach-Object {
        $is32Bit=[int]0
        $Proc = $_
        if (($null -ne $_.Handle) -and [Kernel32.NativeMethods]::IsWow64Process($_.Handle, [ref]$is32Bit)) {
            $Proc = &"$env:windir\SysWow64\WindowsPowerShell\v1.0\powershell.exe" -NoProfile -Command "Get-Process -Id $($_.Id) | ConvertTo-Json" | ConvertFrom-Json
        }
        $MM = $Proc.MainModule | Select-Object -ExpandProperty FileName
        $Modules = $($Proc.Modules | Select-Object -ExpandProperty FileName)
        $currPID = $Proc.Id

        foreach($Module in $Modules) {
            $o = "" | Select-Object Name, Path, MD5, ProcessName, ProcPID, LastWriteTimeUtc, Signer, Category
            $o.Category = "DLL Search Order Hijacking"
            $o.Name = $Module.Substring($Module.LastIndexOf("\") + 1)
            $o.Path = $Module
            $sign = Get-Signature $Module
            $o.Signer=$sign
            if ($sign -eq "(Verified) Microsoft Corporation" -or $sign -eq '(Verified) "McAfee'){
                Continue
            }
            $o.MD5 = Get-FileHash $Module
            $o.ProcessName = ($MM.Split('\'))[-1]
            $o | Add-Member NoteProperty CommandLine (Get-WmiObject Win32_Process -Filter "Handle = '$currPID'" | Select-Object CommandLine).CommandLine -Force
            $o.ProcPID = $currPID
            $file = Get-Item -Force $Module
            $o.LastWriteTimeUtc = Get-Date -Date $file.LastWriteTimeUtc  -Format "MM-dd-yyyy HH:mm:ss tt"
            $o
        }
    }
}

